INSERT INTO `ServiceProfile` VALUES (1,2285,6,'A',2285,'<p>Trocar o perfil para impressão de Os de manutenção no período de ferias da Simone Borba. Já autorizado via e-mail.</p>',1,'<p>Ok.</p>',NULL,NULL,NULL,9),(2,2568,19,'A',2568,'Gostaria de habilitar a rotina de consulta, do sistema de contabilidade, para que eu possa verificar os lançamentos feitos, e emitir razão. Somente consulta.',1,'<p>Dna. Claudia,</p><p>Já existe um grupo no totvs de somente consulta ao modulo contabilidade que foi alocado no perfil do Thiago.</p><p>A Dna. Denise passou a solicitação / autorização por e-mail&nbsp;</p><p>Este processo é para registro da solicitação e alteração do perfil</p>',NULL,NULL,NULL,2),(3,2568,19,'A',2664,'<p>Favor realizar alteração no perfil da Flavia, para que a mesma possa realizar lançamentos na rotina de movimentação bancária. Lançamento de recebimento, resgate e aplicação, tarifas bancarias.</p>',1,'<p>NO caso como a Flavia foi promovida no setor ela devera passar a possuir o perfil de analista na totvs.</p><p>Desta forma esta função será visível no perfil dela.</p>',NULL,NULL,NULL,2),(4,938,6,'A',938,'<p>Preciso retirar os relatórios que a Simone retira no sistema mas não tenho as opções. Para enviar o de desempenho da equipe dos serviços feitos.</p><p>Obrigado</p><p><br></p>',NULL,NULL,NULL,NULL,NULL,1);
