INSERT INTO `ServiceSystem` VALUES (1,2335,14,'#525 - Credit Date Padrão','<p><span style=\"font-size:11.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:PT-BR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">O\r\nsistema irá ler o arquivo de retorno do banco e identificar a Data de Crédito e\r\na origem do arquivo (qual banco pertence) automaticamente.</span><br></p>','<p><span style=\"font-size:11.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:PT-BR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">O\r\nresponsável pela importação do arquivo da tesouraria importou alguns arquivos\r\ncom a data de crédito errada e informando o banco errado (Informar o banco\r\nBradesco onde deveria ser HSBC) causando grande diferença entre Sistema x Banco</span><br></p>','<p><span style=\"font-size:11.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:PT-BR;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Como\r\nos dados já estão dentro do arquivo o usuário não precisa digitá-los novamente,\r\nficando o sistema assim mais forte contra falhas operacionais.</span><br></p>',9,1,'<p>Concordo.</p>',NULL,1,'<p>Ok, com esta função o sistema apresenta maior segurança.</p>','1503942952018_Credit_Date.pdf'),(2,2335,15,'#482 - Ajuste e Inclusão de novo campo no documento Reference Card','<p class=\"MsoNormal\" style=\"font-family: Roboto, arial, sans-serif;\"><span style=\"font-size: 18.6667px;\"><b style=\"\"><u style=\"\"><font color=\"#ff0000\">Custo da Modificação: 3 horas</font></u></b></span></p><p class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\"><u><span style=\"font-size: 14pt; line-height: 21.4667px;\">Sistema Admissions:</span></u></span></p><p class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\">&nbsp;&nbsp;&nbsp; Alterar o PDF&nbsp;<span style=\"font-size: 10.5pt; line-height: 16.1px; font-family: Arial, sans-serif; background: whitesmoke;\">reference card da seguinte forma:</span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 41.25pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span lang=\"EN-US\" style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span lang=\"EN-US\">Mudar de&nbsp;<span style=\"font-weight: 700;\">NEW CHILD TO START ON:&nbsp;</span>para&nbsp;<span style=\"color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">New Child to Start On</span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 41.25pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Na primeira linha (logo abaixo do cabeçalho), será dividida em 3 partes. Será incluído mais um campo no lado direito, onde será impresso&nbsp;<span style=\"font-weight: 700;\">Enrolment Number&nbsp;</span>e conterá a matrícula do aluno.</span>&nbsp;</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 41.25pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Só será apresentado a matrícula do aluno quando o &nbsp;reference card for reimpresso após o aluno ser importado pelo sistema escolar, ou quando houver um regresso de aluno.&nbsp;</span></p>','<p>Serviço solicitado pela Adriana.</p>','<p>Serviço solicitado pela Adriana.<br></p>',7,1,'<p>Complemento de uma melhoria que foi solicitada no passado e não foi feita, precisa ser feito.</p>',NULL,1,'<p>Processo de melhoria do formulário hoje impresso</p>',NULL),(3,2335,17,'#531 - Mais de um Aprovador de Estoque','<p><b><font color=\"#ff0000\">Tempo Orçado: 10h</font></b></p><p style=\"font-family: Roboto, arial, sans-serif; font-size: 14px;\"><b style=\"\"><font color=\"#0000ff\">PURCHASING ONLINE</font></b></p><ol style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><li><b>Cadastro de Usuários / hierarquia de aprovação de pedidos de Estoque</b></li><ol><li><i>Será criada uma nova tabela no banco de dados para que o controle de aprovação de estoque permita que cada funcionário (usuário) possa ter mais de um aprovador de estoque.</i></li><li><i>Criar query para migrar dados da tabela de usuários para nova tabela.</i></li><li><i>Alterar a forma de seleção colocando checkboxes para evitar o problema atual do CTRL + Click</i><br></li></ol><li><b>Relatório \"Lista de Aprovadores de Estoque\" - Alterar para ler as aprovações da nova tabela.</b><br></li><li><b>Aprovação de Estoque - Alterar para respeitar a hierarquia de aprovação com a nova tabela.</b><br></li><li><b>Cadastro de Usuários / Permissões Contas Orçamentárias - Alterar a forma de seleção colocando checkboxes para evitar o problema atual do CTRL + Click</b></li></ol>','<p>1 - Hoje o Sistema não permite que um funcionário tenha mais de um aprovador de estoque, essa requisição se iniciou no Robert Lees, onde solicitou que o Jorge Luiz também pudesse aprovar a requisição de seus subordinados.<br>2 - Alterar o relatório de aprovações para funcionar com a nova estrutura<br>3 - Alterar a modificação de aprovadores para utilizar a nova estrutura<br>4 - Alterar a forma como é selecionado os subordinados para evitar falhas.</p>','<p>1,2,3 - Permitir que um funcionário tenha mais de um responsável para exibir as aprovações de estoque.<br>4 - Hoje para atribuir um novo subordinado a um aprovador é necessário segurar o CTRL e ir selecionado os nomes na lista de todos os usuários, sujeito a falhas.</p>',7,1,'<p>A demanda dessa melhoria já existe a algum tempo, recentemente com a solicitação do Robert Less para que o Jorge Luiz aprovasse junto com ele o estoque dos subordinados, decidimos iniciar essa melhoria.</p>',NULL,1,'<p>Melhoria no processo de aprovação de pedidos de estoque.</p>',NULL),(4,2335,17,'#493 - Departamentos - Sistema Purchasing','<p><b><font color=\"#ff0000\">Tempo Orçado: 13h</font></b></p><ol style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><li><b>Inclusão de Pedidos - Tornar o Departamento EDUCACIONAL padrão para pedidos dos usuários Educacionais</b></li><li><b>Criar Cadastro de Contas orçamentarias associadas a linha e filial.</b></li><ol><li><i>Sistema exibe um grid com os registros existentes (Linha / Site / Conta Orçamentária)</i></li><li><i>Usuário poderá Pesquisar por Linha / Site / Conta orçamentária</i></li><li><i>Usuário póderá inserir, editar (Alterar conta orçamentária) ou deletar registros.</i></li><li><i>Não será possível inserir registros com linha e site duplicados.</i></li></ol></ol>','<p>1 - Todo pedido que partir do Departamento Educacional já vir preenchido como tal.<br></p><p>2 - O estoque irá vincular Unidade / Linhas / Sublinhas para que não precisem selecionar o budget do produto sempre que tiver que baixar um produto.</p>','<p><span style=\"font-weight: 700;\">Alteração para agilizar o trabalho do Departamento de Estoque</span><br></p>',7,1,'<p>Melhoria para agilizar o processo de baixa do estoque. Concordamos.</p>',NULL,1,'<p>Agilidade no processo</p>',NULL),(5,2335,14,'#487 - Log de alterações na Web','<p><b><font color=\"#ff0000\">Tempo Orçado: 4h</font></b></p><p><span style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><b>Área Segura</b></span></p><ol><li><i><span style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\">Alterar a geração de logs para identificar o usuário que realizou a alteração. Isso ocorrerá quando a alteração for realizada por um usuário, se for pelo responsável continuará gravando a matricula do aluno.</span><br></i></li><li><span style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><i>Sistema Escolar / Relatório Operation Log - Alterar para Apresentar o nome do usuário em vez do Login que atualmente é a matricula e não nos permite identificar facilmente o usuário.</i><br></span></li></ol><p style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\">&nbsp;</p>','<p>1 - Fazer com que a Área Segura gere logs quando dados de responsáveis forem alterados por funcionários Administrativos<br>2 - Fazer com que nos Logs apareçam o nome do usuário e não a matrícula, facilitando o entendimento.&nbsp;&nbsp;&nbsp;&nbsp;</p>','Auxiliar na Auditoria de Logs',7,1,'<p>Melhoria para garantir a integridade dos dados quando são atualizados pela Web, Concordamos.</p>',NULL,1,'<p>Melhoria no controle de acesso</p>',NULL),(6,2335,14,'#485 - Informar qual Servidor esta se Conectando','<p><b><font color=\"#ff0000\">Tempo Orçado: 3h</font></b></p><ol style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><li><b>Sistema Escolar - Colocar na barra de status, ao lado do nome do banco Oracle, o nome do banco MySQL</b></li><li><b>EscolaWeb (sinronismo) - Colocar no rodapé do form o nome do Banco Oracle e MySQL</b></li></ol>','<p>Exibir informações no Sistema Escola sobre qual banco de dados está conectado.</p>','<p>Mitigar erros de operação que envolvem banco de dados diferentes.</p>',7,1,'<p>Melhoria já discutida em reunião algumas vezes. Concordamos.</p>',NULL,1,'<p>Atender necessidade ICT</p>',NULL),(7,2335,14,'#451 - Relatório de Boletos Não Gerados','<p><b><font color=\"#ff0000\">Tempo Orçado: 12h</font></b></p><p class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><b>O relatório conterá as seguintes informações:</b></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Matricula do aluno</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Parcela</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Vencimento</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Tipo de boleto</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Mensagem de erro</p><p class=\"MsoNormal\" style=\"margin-left: 4.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><b>Os seguintes diagnósticos serão listados:</b></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Aluno devedor</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Aluno com parcela abonada</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Aluno com a parcela paga</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Aluno com status diferente de normal</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Aluno com pagamento parcial, mas o check box Print Slip with Advanced Pay está desmarcado</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Aluno pagou anuidade</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Aluno com dívida negativa</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Quando a data de matrícula é superior ao vencimento da parcela</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Data de vencimento inserida(Due Date) é inferior a data de vencimento padrão&nbsp;</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 40.5pt; color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px; text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Informar os alunos que são Staff Child</p>','<p>Hoje quando o Sistema não gera boletos seja qual for o motivo, dependendo do caso precisamos entrar em contato com o fornecedor para que o mesmo identifique a causa.</p>','<p>Com essa solução, colocamos todos os casos possíveis quando os boletos não são gerados, dessa forma o próprio setor irá conseguir resolver o problema.</p>',7,1,'<p>Melhoria para economizar em atendimentos com o fornecedor.</p>',NULL,1,'<p>Agilidade no processo</p>',NULL),(8,2335,18,'#320 - Mensagem ao Gravar Nota Fiscal no Sistema','<p><b><font color=\"#ff0000\">Tempo Orçado: 4h</font></b></p><ul style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><li>Cadastro de Notas fiscais - Será alterado para após a confirmação de inserção da nota, realizar leitura do banco de dados para confirmar a inclusão da Nota, enviar email para o usuário logado, com os dados da nota fiscal conforme definido abaixo e mostrar mensagem de confirmação.</li><ul><li>Dados do Email:<br><p><span style=\"font-weight: bold;\">Subject.:</span>&nbsp;[Purchasing] Nota Fiscal XXXXX&nbsp;- Requisição XXXXXX</p><p><span style=\"font-weight: bold;\">Body.:</span>&nbsp;No corpo do e-mail deve conter os seguintes dados.:&nbsp;</p><p>Número da Nota, Emissão, Vencimento, Fornecedor e Requisição e usuário responsável pela entrada.</p></li></ul></ul>','<p>O sistema não emite nenhuma mensagem informando se concluiu a tarefa com sucesso ou não.</p>','<p>Dessa forma o sistema ficará mais seguro pois o responsável pela pelo recebimento poderá provar que inseriu a nota caso tenha o e-mail.</p>',7,1,'Melhoria para assegurar a rotina de inclusão de nota fiscal no sistema Purchasing.',NULL,1,'<p>Agilidade no processo</p>',NULL),(9,2335,18,'#251 - Criptografar arquivo de Configuração','<p><b><font color=\"#ff0000\">Tempo Orçado: 18h&nbsp;&nbsp;&nbsp;&nbsp;</font></b></p><ol style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 14px;\"><li>Armazenar a senhas de Conexão com o banco e Envio de email de forma Criptografada no Arquivo de configuração (XML)</li><ol><li>Será utilizada o mesmo algoritimo de &nbsp;criptografia que foi utilizado no Sistema Escolar</li><li>Todas as funções que utilizam senha serão alteradas para pegar a senha discriptografada</li></ol></ol>','<p>Hoje as senhas do banco de dados e e-mail de envio ficam expostas no Banco de Dados, qualquer indivíduo com o mínimo de conhecimento em informática consegue ter acesso ao mesmo e nos causar um problema,&nbsp;&nbsp;&nbsp;&nbsp;</p>','Grande passo na segurança dos sistemas internos, a mesma mudança foi feita no Sistema Escolar a alguns meses atrás que encontrava-se na mesma situação.',7,1,'<p>Precisa ser feito com urgência, isso afeta diretamente a integridade das informações.</p>',NULL,1,'<p>Melhoria de controle</p>',NULL),(10,1046,15,'Admissions System / Letter of place offered - mudanças','<p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Fellipe,</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">No Admissions\r\nSystem, quando clicamos na área “Enrolment Available”, temos que marcar uns\r\nitens e depois clicar em <b>SAVE AND GENERATE EMAIL</b>.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\"><br>\r\nAo fazer isso, um draft de email é feito e alguns documentos tambem são\r\ngerados.&nbsp; Esses documentos podem ser encontrados em formato PDF na área\r\n“Print Documents”.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Um desses documento\r\nse chama:<b> Acceptance Letter</b>. Ele é gerado em Inglês e em Português, no\r\nmesmo PDF. </span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Preciso por favor\r\natualizar / mudar o texto do <b>Acceptance Letter</b>.&nbsp; Abaixo segue o\r\ntexto do CORPO da <b>Acceptance Letter</b>, tanto em inglês quanto em\r\nportuguês. &nbsp;&nbsp;Lembro que as partes marcadas em <span style=\"background:\r\nyellow\">AMARELO</span> são partes em que o sistema automaticamente insere a\r\ninformação correta, como nome do aluno, data, unidade da escola, him OU her\r\netc...&nbsp; </span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">As outras partes\r\ndeste documento como cabeçalho e rodapé permancem sem alterações. </span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Vocês poderiam por\r\nfavor solicitar essas alterações?</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Obrigada.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><b><u><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;color:red\">PARTE EM\r\nINGLÊS</span></u></b><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">Rio de Janeiro, <span style=\"background:yellow\">date\r\nin the format 03 April 2013</span></span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">Dear<span style=\"background:yellow\">??????</span>,</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">I am delighted to offer <b><span style=\"background:\r\nyellow\">name of child</span></b> a place in <span style=\"background:yellow\">Nursery</span>\r\nat the <b><span style=\"background:yellow\">Botafogo Site</span> </b>of The\r\nBritish School, starting on <b><span style=\"background:yellow\">date in the\r\nformat 03 April 2013</span></b>.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">On behalf of our school community, I would like to\r\nwelcome <b><span style=\"background:yellow\">name of child</span></b> to The\r\nBritish School and wish <span style=\"background:yellow\">him</span> every\r\nsuccess and happiness with us. We look forward to supporting <b><span style=\"background:yellow\">name of child</span></b> as a new member of the\r\nschool and trust that we can work in partnership. </span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">We are proud of our Vision,<b> </b>Mission, and Core\r\nValues of: Compassion, Integrity and Determination. To learn more about our\r\nschool’s philosophy approach, as well as the rich curricula and co-curricular\r\nactivities, please consult our (<a href=\"http://www.britishschool.g12.br\" target=\"_blank\">www.britishschool.g12.br</a>) and prospectus. If you would like\r\nto discuss anything about the school, please do not hesitate to contact us. </span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">We have a long tradition of families in our school and\r\nwe welcome siblings’ applications, which may have priority according to our\r\nAdmissions’ Policy. However, places cannot be guaranteed and each entry process\r\nis treaded individually.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">Please be aware that if your child is joining the\r\nschool at the beginning of Term 1 (February), you are responsible for payment\r\nof the monthly fees, starting in January of the entry year. If your child is\r\njoining the school at the beginning of Term 2 (August), you are responsible for\r\npayment of the monthly fees, starting in July of the entry year.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">If you would like to accept the offer of this place,\r\nyou are kindly requested to contact us immediately at the </span><strong><span lang=\"EN-GB\" style=\"font-size:11.0pt;mso-ansi-language:EN-GB;font-weight:normal\">Admissions,\r\nCommunications &amp; Marketing office</span></strong><span lang=\"EN-GB\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:\r\nEN-GB\"> </span><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">in order to continue with the enrollment process.<b> </b>Should\r\nyou decide not to proceed with <b><span style=\"background:yellow\">name of child</span></b>’s\r\napplication to The British School, we would appreciate you letting us know as\r\nsoon as possible.&nbsp; </span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">We look forward to establishing a nurturing\r\npartnership with you and welcome you to our school.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;text-align:center\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;text-align:center\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-US\">Yours sincerely,</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-US\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;text-align:center\"><b><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-US\">John Nixon MBE</span></b><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;text-align:center\"><b><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-US\">Director</span></b><o:p></o:p></p><p class=\"MsoNormal\"><b><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;color:red\">&nbsp;</span></b><o:p></o:p></p><p class=\"MsoNormal\"><b><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;color:red\">&nbsp;</span></b><o:p></o:p></p><p class=\"MsoNormal\"><b><u><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;color:red\">PARTE EM\r\nPORTUGUÊS</span></u></b><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Prezado\r\n<span style=\"background:yellow\">??????</span>,</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Tenho\r\num grande prazer em oferecer uma vaga no <b><span style=\"background:yellow\">Nursery</span>\r\ndo <span style=\"background:yellow\">Site de Botafogo</span></b> da Escola\r\nBritânica, para <b><span style=\"background:yellow\">name of child</span></b> a\r\npartir de <b><span style=\"background:yellow\">Primeiro Semestre de 2014.</span></b></span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"PT\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\ncolor:#212121;mso-ansi-language:PT\">Em nome da nossa comunidade escolar,\r\ngostaria de receber o <b><span style=\"background:yellow\">nome da criança</span></b>\r\nna Escola Britânica e desejo-lhe todo o sucesso e felicidade conosco. Estamos\r\nansiosos para apoiar <b><span style=\"background:yellow\">nome da criança</span></b>\r\ncomo um novo membro da escola e tenho total confirnça &nbsp;que podemos\r\ntrabalhar em parceria.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><pre style=\"background:white\"><span lang=\"PT\" style=\"font-size:11.0pt;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;;color:#212121;mso-ansi-language:PT\">Temos orgulho de nossa Visão, Missão e Valores Fundamentais de: Compaixão, Integridade e Determinação. Para saber mais sobre a abordagem da filosofia da nossa escola, bem como sobre os ricos currículos e as atividades co-curriculares, consulte nosso site (<a href=\"http://www.britishschool.g12.br\" target=\"_blank\">www.britishschool.g12.br</a>) e o </span><span lang=\"PT\" style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:\r\nPT\">prospecto. Caso queira conversar sobre qualquer coisa realtivo a escola, não hesite em contactar-nos.</span><o:p></o:p></pre><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Temos uma longa tradição de famílias em nossa\r\nescola e nós agradecemos as inscrições de irmãos, que podem ter prioridade de\r\nacordo com nossa Política de Admissão. No entanto, os lugares não podem ser\r\ngarantidos e cada processo de entrada é analisado individualmente.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-autospace:none\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Por favor, estejam cientes que ao ingressar\r\nna escola no início do primeiro semestre (Fevereiro), vocês são responsáveis\r\npelo pagamento das mensalidades escolares desde o mês de Janeiro do ano de\r\nentrada. Ao ingressar na escola no início do segundo semestre (Agosto), vocês\r\nsão responsáveis pelo pagamento das mensalidades escolares desde o mês de Julho\r\ndo ano de entrada.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Caso\r\naceitem a oferta desta vaga, pedimos a gentileza de entrar em contato conosco\r\nimediatamente no Departamento de de Admissões, Comunicação e Marketing&nbsp;\r\npara que possamos dar continuidade ao processo de matrícula.&nbsp; Caso não\r\npretenda prosseguir com a matrícula de <b><span style=\"background:yellow\">name\r\nof child</span></b>, agradecemos se puder nos avisar disto, o quanto\r\nantes.&nbsp; </span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-autospace:none\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Estamos\r\nansiosos por estabelecer uma parceria de sucesso com você e recebê-lo na nossa\r\nescola.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;text-align:center\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Cordialmente,</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" align=\"center\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;text-align:center\"><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-US\">John Nixon MBE</span><o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\