INSERT INTO `ea_documentacao` VALUES (1,'2016-10-13 14:28:16','192.168.4.152','Cálculo da rematrícula','A rematrícula será 40% do valor da mensalidade do ano seguinte. Se for paga antecipadamente(novembro ou dezembro), a primeira mensalidade do ano terá um desconto igual ao valor pago.'),(2,'2016-10-21 09:52:40','192.168.4.152','Diagramação do sistema','https://drive.google.com/a/britishschool.g12.br/file/d/0B0D6lbLR9qlZeHBja1JMVVJHYUk/view?usp=sharing'),(3,'2016-10-21 11:17:16','192.168.4.152','Reference Card','É um documento que o professor recebe quando o aluno ingressa na escola, neste documento possuem informações a respeito do aluno. Podemos dizer que é uma carta de apresentação'),(4,'2016-11-01 16:06:16','192.168.4.152','Vague','É a opção que torna o número de matrícula disponível novamente. Usado por exemplo quando um aluno é importado do ADMISSIONS erroneamente mais de uma vez. Acontecia devido a perda de conexão, etc.\r\n\r\nOBS: Caso já existam informações financeiras associadas à matrícula, a opção não ficará disponível.'),(5,'2016-11-03 15:27:08','192.168.4.152','Cada novo ano, realizar esse procedimento',' '),(6,'2016-12-06 10:01:06','192.168.4.152','Procedimento - Manutenção de turma - Aceite - Rematrícula','Procedimento para auxiliar na virada de turma, rematrícula e área segura.\r\n\r\nNo final do arquivo existe um resumo dos erros encontrados nos casos de aceite da área segura.'),(7,'2016-12-06 10:08:22','192.168.4.152','Donation - Query para abonar(quitar) ','Seguem abaixo queries para quitar a parcela 1 que estava pendente:\r\n\r\nupdate alunotaxa set statustaxa = \'Q\' where idalunotaxa = NUMERO_ID_DONATION;\r\nupdate alunotaxaparcela set statustaxaparcela = \'Q\' where idalunotaxa = NUMERO_ID_DONATION and parcelataxa = 1;\r\ncommit;\r\n\r\nPrecisa rodar as 2 queries nas 2 bases, Oracle e Área Segura.\r\nalunotaxa é a tabela mãe e a tabela alunotaxaparcela estão as parcelas que compõem o donation.\r\n\r\nOs status que podem ter esse campo podem ser:\r\n\r\nN - Em aberto\r\nP - Pago Parcialmente\r\nQ - Pago integralmente\r\nD - Devolvido\r\n\r\nImportante: As queries devem ser rodada no Oracle e no Mysql Área Segura.'),(8,'2016-12-19 11:08:56','192.168.4.152','Criando uma nova turma','Para criar uma nova turma, o usuário deve ir no ano desejado e acessar o menu Records > Academic > ClassList\r\n\r\nImportante é criar a turma e depois virar o ano pois caso a virada de ano seja feita antes, as turmas criadas posteriormente não possuirão description.\r\n\r\n');
/*!40000 ALTER TABLE `ea_documentacao` ENABLE KEYS */;
UNLOCK TABLES;

