INSERT INTO `form_just_sugestoes` VALUES (1,'','2016-05-11 10:41:42','O sistema deve preencher a matrícula do funcionário quando o mesmo realizar login'),(2,'','2016-05-11 10:42:00','O sistema deve preencher a unidade do funcionário quando o mesmo realizar login'),(3,'','2016-05-11 10:43:02','O sistema deve preencher a data atual quando algum usuário clicar para preencher qualquer formulário'),(4,'','2016-05-11 10:44:40','O sistema deve preencher o departamento do funcionário quando o mesmo realizar login'),(5,'','2016-05-11 10:44:52','O sistema deve preencher o nome do funcionário quando o mesmo realizar login'),(6,'','2016-05-11 10:45:30','No perfil de Supervisor, o sistema poderia ter a opção de criar justificativa para um subordinado'),(7,'','2016-05-11 10:53:16','Anexar arquivos aos formulários - exemplo: quando algum funcionário de algum setor estiver doente, o supervisor entrará no sistema para justificar sua falta e poderá anexar o atestado médico.'),(8,'','2016-05-11 10:55:03','Nas opções de aprovação, meus pedidos e minhas aprovações ter como filtrar pelas colunas existentes.'),(9,'','2016-05-11 11:03:18','O perfil do Supervisor do Departamento Pessoal, o sistema poderia ter filtros para pesquisar por matrícula, data inicial e data final. Existem outros tipo de pesquisa que poderiam ser importantes?\r\n\r\n'),(10,'','2016-05-11 11:11:38','O supervisor de ASG em seu perfil pode escolher para qual funcionário ele vai justificar. Desta forma o mesmo não precisa logar no sistema com cada funcionário. E gerar o log do que esta sendo feito. '),(12,'','2016-05-11 11:47:04','O sistema deve ter uma coluna para a data em que o formulario esta sendo preenchido'),(13,'','2016-05-11 12:03:34','O sistema devera ter um calendário para que quando o funcionário for preencher a data da ocorrência não tenha como preencher coma a data errada'),(14,'','2016-05-11 12:04:17','Resposta Sugestão #9 O ideal seria que todos do DP tivessem seu perfil habilitados para visualizar todas as justificativas da empresa. Filtrar também por data de preenchimento do formulário.'),(15,'','2016-05-11 12:15:40','O sistema poderá emitir um alerta ao usuário que esta fazendo a justificativa após o período de fechamento, o ponto fecha dia 10 seria dado 3 dias de tolerância para as justificativas deste período. As justificativas com emissão de alerta poderiam aparecer no relatório geral com uma cor diferenciada. O mesmo sistema vale também para o aprovador, ou seja, justificativas aprovadas após a data de corte também aparecer no relatório geral com uma cor diferenciada.'),(20,'Fellipe','2016-05-11 12:26:34','Permitir login no sistema utilizando matrícula.'),(21,'adriana alves','2016-05-18 13:02:35','Gostaria de acrescentar a sugestão que o formulário de justificativas, poderia ser diferente, ao inves de termos que colocar o nome e a matrícula do funcionário, poderia haver uma coluna com todos os nomes dos funcionários daquele setor, aonde o gestor poderia se quisesse fazer os lançamentos sem ter que ficar procurando o login da pessoa, só selecionar o nome que já poderia aparecer automaticamente o nome completo e já a matrícula do mesmo. Isso agilizaria muito. Grata.');
/*!40000 ALTER TABLE `form_just_sugestoes` ENABLE KEYS */;
UNLOCK TABLES;

