ncha vermelha. Minha esposa entrou em contato com a pediatra dele, a  mesma só respondeu na terça de manhã, dizendo que era para o levarmos para o hospital com urgência pois era sangue. Eu já estava aqui em botafogo quando minha esposa me ligou dizendo que era para levarmos para o hospital. Então tive que ir de Uber para chegar o mais rápido possível no hospital.\r\nMeu filho fez exames de sangue e ultra sonografia abdominal, a pediatra disse que houve uma Invaginação Intestinal, isso ocorreu devido as diarreias constantes do final de semana. Os órgãos ficam muito flácidos e acaba que um órgão entra no outro, ocasionando a diarreia com sangue. \r\nEstou a disposição para esclarecer qualquer dúvidas.\r\nDaniel Radamés',1894,462,'2017-05-25 07:55:13'),(5402,'2017-05-24 12:41:21',6,4,2692,'portaria','Botafogo','09:00:00','18:00:00','2017-05-28','07:00:00','17:00:00','Reforço na portaria e acompanhamento da empresa Pama.',870,648,'2017-05-26 09:35:33'),(5403,'2017-05-25 07:52:14',4,2,1202,'mensageiro','Barra','08:00:00','17:00:00','2017-05-24','17:01:00','18:04:00','Acompanhando a ALAMO.',1202,1160,'2017-05-26 08:43:44'),(5404,'2017-05-25 07:54:31',3,2,462,'coordenacao','Botafogo','08:00:00','17:00:00','2017-05-24','08:00:00','17:00:00','Neste dia fui à São Paulo para visitar o Colégio Miguel de Cervantes e também a Feira Internacional de Segurança - EXPOSEC',462,648,'2017-05-26 09:35:38'),(5405,'2017-05-25 08:17:43',5,2,603,'portaria','Botafogo','06:30:00','15:30:00','2017-05-24','12:26:00','16:00:00','bom dia, minha saída antecipada, foi devido minha esposa esta passando mal, e estava sozinha com meus filhos gêmeos, que tem 2 anos e 5 meses.   ',603,462,'2017-05-25 09:23:59'),(5406,'2017-05-25 09:23:39',5,2,1051,'babas','Botafogo','07:30:00','16:30:00','2017-05-29','16:00:00','16:30:00','NESTE DIA A FUNCIONÁRIA PEDIU AUTORIZAÇÃO PARA TRABALHAR DAS 07:00 ÀS 16:00 HORAS, PARA COMPARECER A UM EXAME MÉDICO IMPORTANTE E URGENTE. PEÇO AUTORIZAÇÃO.',462,462,'2017-05-25 09:24