INSERT INTO `justificativas_sugestoes` VALUES (1,'2016-09-14 15:01:51',530,''),(2,'2016-09-16 07:30:17',1893,'Uma duvida que tenho, meu horário de trabalho é de 7.30h as 16.30h e no sistema de justificativa está de 8h às 17h, horário errado.  Isso não vai dar problema pra mim não é?\nGrato'),(3,'2016-10-31 07:10:52',938,'bom dia\nno sistema anterior quando erramos o horário dava para cancelar e fazer outro por exemplo\no do dia 18/10 eu coloquei a saída as 18:03 que na verdade seria 17:37 teria como corrigir este horário?\natt,'),(4,'2016-12-09 12:12:17',2609,'TERIA QUE TER A OPÇÃO PARA CANCELAR UMA OS DE JUSTIFICATIVA\nEXEMPLO ABAIXO:\nEU QUERIA COLOCAR APENAS UM DIA DE FALTA  QUE SERIA DIA 05/12/2016\nGOSTARIA DE CANCELAR O DIA 06/12/2016\n\n 2420	Antonio Marcos Dos Santos	Falta	06/12/2016	-	-	EXAMES MEDICO APEDIDO DO DP GRATO	Aguardando\n2419	Antonio Marcos Dos Santos	Falta	05/12/2016	-	-	EXAMES MEDICO APEDIDO DO DP GRATO	Aguardando\nGRATO'),(5,'2017-01-02 16:57:27',2414,''),(6,'2017-05-12 10:58:53',938,'Bom dia\nseria possível acrescentar os funcionários novos da manutenção abaixo?\nJose Henrique Guedes de oliveira\nGelson Alves Nerys\nObrigado'),(7,'2017-06-08 14:13:00',2612,''),(8,'2017-06-26 16:45:17',734,''),(9,'2017-09-06 09:33:40',938,'por favor \npreciso que acrescente na lista\nRobson oliveira inspetor barra\nmárcio clemente manutenção Barra\nDilvanio Sg Barra\nAtt,');
